import React from 'react';
import './input.css'
import PropTypes from 'prop-types';


const InputText = ({ name, callback, value }) => (
  <div class="group">
    <input required="" type="text" class="input" onChange={ callback } />
    <span class="highlight"></span>
    <span class="bar"></span>
    <label>name</label>
  </div>
);

InputText.propTypes = {};

InputText.defaultProps = {};

export default InputText;
